import React from "react";
import './style.css';

function Grid() {
  return (
    <div class="grid-container">
      <div class="grid-item">
        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.shutterstock.com%2Fblog%2Ftake-pictures-moon&psig=AOvVaw26g-r2PzTeeTFahmQlSMee&ust=1614654489183000&source=images&cd=vfe&ved=0CAYQjRxqFwoTCLDF_eyOju8CFQAAAAAdAAAAABAI" alt="moon" />
      </div>
      <div class="grid-item">2</div>
    </div>
  )
}

export default Grid;
